 import React  from 'react';
import ReactDOM from 'react-dom';
import Card from './Card.jsx';
import Sdata from '/Sdata.jsx';




ReactDOM.render(
<>

<Card
 imgsrc={Sdata[0].imgsrc}
 name={Sdata[0].name}
 content={Sdata[0].content} 
 link={Sdata[0].link}
  />

<Card 
imgsrc={Sdata[1].imgsrc}
 name={Sdata[1].name}
 content={Sdata[1].content} 
 link={Sdata[1].link}
  />

<Card 
imgsrc={Array[2].imgsrc}
 name={Array[2].name}
 content={Array[2].content} 
 link={Array[2].link}
  />

<Card 
imgsrc={Array[3].imgsrc}
 name={Array[3].name}
 content={Array[3].content} 
 link={Array[3].link}
  />

</>,
 document.getElementById("root")

);
